import React from "react";

export const Tile = ({ tiles }) => {
  return (
    <div className="tile-container">
      {Object.entries(tiles).map(([key, value], index) => (
        <p key={index} className={index === 1 ? "title-tiles" : "tiles"}>
          {key}: {value}
        </p>
      ))}
    </div>
  );
};
